import React from "react";
import '../stylesheets/comingSoon.scss'

class ComingSoon extends React.Component {
    render() {
        return (
            <div className="coming-soon">
                <div className="nhg-logo"></div>
                <div className="maintenance-wrap">
                    <div className="maintenance-anim">
                    </div>
                    <section className="maintenance-content">
                        <h1>Pardon our dust.</h1>
                        <p>The website is currently under construction and will be back up in a few days.</p>
                        <footer>If you need to you can always <a href="mailto:robert@nhg.design">contact us</a></footer>.
                    </section>
                </div>
            </div>
        )
    }
}

export default ComingSoon
